  true,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of snow depth data
  from nine study areas, within nthree larger-scale areas in northern Colorado (Fraser,
  North Park, and nRabbit Ears Meso-cell Study Areas (MSAs)). The study areas range
  from low-relief (flat topography) nunforested areas with shallow snow covers, to
  high-relief (complex topography)ndensely forested areas with deep snow covers. Parameters
  measured include nsnow depth, snow wetness, snow temperature, soil temperature,
  and canopy cover. Photos were taken of nsurface roughness and terrain. Data were
  collected during February and March 2002 and 2003. This data nset is part of the
  NASA Cold Land Processes Field Experiment (CLPX).\",\n\t\"license_title\": \"U.S.
